


function imageDesignGeneric(logo){
	var id = document.getElementById("id").value;
	var strBase64 = document.getElementById("strBase64").value;
	var resultBase64Avatar = document.getElementById("resultBase64Avatar").value;
	var base64Backside = document.getElementById("base64Backside").value;
	var sissors = "../img/design/sissors.png"; 
	
	var doc = new jsPDF()
	var qr ='data:image/png;base64,'+strBase64;

	/* Placeholder start */
	/* Image 40% Configuration for 3.7 x 3.5 cm*/
	//Placeholder sm
	doc.setFontSize(8);
	doc.text(1, 48, '3,7 x 3,5 cm / 1,45 x 1,38 inch');
	
	/* Image 50% */
	//Placeholder sm
	doc.setFontSize(9);
	doc.text(51, 65, '4,5 x 4,9 cm / 1,77 x 1,93 inch');
	
	/* Image 70% */
	//Placeholder lg
	doc.setFontSize(10);
	doc.text(112, 85, '6,3 x 6,7 cm / 2,48 x 2,64 inch');
	/* Placeholder end */
	
		/* Image 40% */
		doc.setFontSize(8);
		doc.text("Frente / front", 1, 4);
		/* qr start sm */
		doc.addImage(qr, 'PNG', 0, 5, 35, 35);
		doc.addImage(logo, 14, 19 , 7, 7);
		// Empty sm square
		doc.rect(1, 6.3, 33.4, 34.9);
		doc.setFontSize(7);
		doc.text(id, 2, 40.5);
		doc.addImage(sissors, 37, 35, 0, 0);
		
		/* Image 50% */
		doc.setFontSize(8);
		doc.text("Frente / front", 51, 4);
		/* qr start md */
		doc.addImage(qr, 'PNG', 50, 5, 50, 50);
		doc.addImage(logo, 69, 24 , 12, 12);
		// Empty middle square
		doc.rect(51, 6.7, 48, 50.5);
		//Font size
		doc.setFontSize(10);
		doc.text(id, 53, 56);
		doc.addImage(sissors, 101, 51, 0, 0);
		doc.addImage(resultBase64Avatar, 56.5,89, 0, 0)
		doc.addImage("../img/warningBar150x14.png", 'PNG' , 51.2, 89, 5, 37);
		doc.addImage("../img/warningBar150x14.png", 'PNG' , 94, 89, 5, 37);
		doc.addImage("../img/warningBar150X14h-short.png", 'PNG' , 70, 76, 29, 6.7);
		
		/* Image 70% */
		doc.setFontSize(8);
		doc.text("Frente / front", 112, 4);
		/* qr start lg */
		doc.addImage(qr, 'PNG', 110, 5, 70, 70);
		doc.addImage(logo, 137, 31 , 17, 17);
		// Empty lg square
		doc.rect(112, 6.9, 66.3, 70);
		//Font size
		doc.setFontSize(14);
		doc.text(id, 114, 76);
		doc.addImage(sissors, 180, 71, 0, 0);
		
		/* Reverse start */
		var footerLogo = 'data:image/png;base64,';
		/* sm */
		doc.setFontSize(8);
		doc.text("Reverso / back", 1, 57);
		/* Start qr sm */
		doc.rect(1, 60, 33.4, 34.9);
		doc.addImage(footerLogo, 1, 60, 20, 0);
		doc.setFontSize(7);
		doc.text("https://pet-qr.com/id/", 2, 72);
		doc.text(id, 2, 75);
//		doc.text("Si su lector no funciona", 2, 80);
//		doc.text("Coloque este código", 2, 83);
//		doc.text("en su navegador", 2, 86);
//		doc.text("Devuelva a su familia", 2, 92);
		
		/* md */
		doc.setFontSize(8);
		doc.text("Reverso / back", 51, 73);
		/* Start qr md */
		doc.rect(51, 76, 48, 50.5);
		doc.addImage(footerLogo, 51, 76, 20, 0);
		doc.setFontSize(8);
		doc.text("https://pet-qr.com/id/", 52, 85.7);
		doc.text(id, 52, 88.3);
		
		/* lg */
		doc.setFontSize(8);
		doc.text("Reverso / back", 112, 93);
		/* Start qr lg */
		doc.rect(112, 96, 66.3, 70);
		doc.addImage(footerLogo, 112, 96, 20, 0);
		doc.setFontSize(10);
		doc.text("https://pet-qr.com/id/", 132.5, 99.5);
		doc.text(id, 132.5, 102.5);
		doc.addImage(base64Backside, 114,103,0,0);
		/* Reverse end */
		
		var date = Date(Date.now()); 
		
		/* Footer start */
		var footerMolokotech = '../img/design/molokotechFooterLogo.png';
		doc.setFontSize(10);
		doc.text("Fecha/Date = " + date.toString(), 1, 250);
		doc.text("Recomend impresora laser, papel mate o fotográfico, plastificar. / should be laser printed, paper mate or photo paper, plasticizer",1, 255);
		doc.text("Acceso web/ Web Access= https://pet-qr.com/id/" + id, 1, 260);
		doc.addImage(footerLogo, 1, 263, 23, 0);
		doc.text("is Powered by ", 26, 268);
		doc.addImage(footerMolokotech, 50, 263, 34 , 0);
		/* Footer end */
		
		/* Finally saves it */
		doc.save('petQR_Design_a4.pdf');
}

